import React from "react";
import { FirstName, LastName } from "./App";


const Comp3 = () => {
    return (
        <>
            <FirstName.Consumer>{(fname) => {
                return (
                    <LastName.Consumer>{(lname) => {
                        return (
                            <h1>Hey {fname} {lname} Welcome To Our Site</h1>
                        )
                    }}</LastName.Consumer>
                )
            }}</FirstName.Consumer>
        </>
    )
}


export default Comp3;
